{"html":"<div class='jdgm-rev-widg__reviews'><div class='jdgm-rev jdgm-divider-top' data-verified-buyer='true' data-review-id='3b57a10e-e40d-4743-b86b-26513f53c779' data-product-title='Screwdriver Bit Set' data-product-url='/products/bits' data-thumb-up-count='5' data-thumb-down-count='0'> <div class='jdgm-rev__header'>  <div class='jdgm-rev__icon' > I </div>  <span class='jdgm-rev__rating' data-score='5' tabindex='0' aria-label='5 star review' role='img'> <span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span> </span> <span class='jdgm-rev__timestamp jdgm-spinner' data-content='2023-03-28 19:25:25 UTC'></span>    <div class='jdgm-rev__br'></div> <span class='jdgm-rev__buyer-badge-wrapper'> <span class='jdgm-rev__buyer-badge'></span> </span> <span class='jdgm-rev__author-wrapper'> <span class='jdgm-rev__author'>Isaac Rifkin</span> <span class='jdgm-rev__location' >  </span>  </span> </div> <div class='jdgm-rev__content'> <div class='jdgm-rev__custom-form'>  </div> <b class='jdgm-rev__title'>Serviceable Bits</b> <div class='jdgm-rev__body'><p>I accidently welded one of my screwdriver tips to a screw while mains were still on. Ruined the bit, but the screwdriver held up nicely.</p>

<p>Ordered replacements and they are up to the same great quality as the original, no doubt because they are the same. Either way, 5/7 a perfect score.</p></div> <div class='jdgm-rev__pics'>  </div> <div class='jdgm-rev__vids'>   </div> </div> <div class='jdgm-rev__actions'> <div class='jdgm-rev__social'></div> <div class='jdgm-rev__votes'></div> </div> <div class='jdgm-rev__reply'>  </div> </div><div class='jdgm-rev jdgm-divider-top' data-verified-buyer='true' data-review-id='f3b5e091-3916-44f9-85da-1ea0b4f7cf52' data-product-title='Screwdriver Bit Set' data-product-url='/products/bits' data-thumb-up-count='2' data-thumb-down-count='1'> <div class='jdgm-rev__header'>  <div class='jdgm-rev__icon' > J </div>  <span class='jdgm-rev__rating' data-score='5' tabindex='0' aria-label='5 star review' role='img'> <span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span> </span> <span class='jdgm-rev__timestamp jdgm-spinner' data-content='2023-03-27 00:12:05 UTC'></span>    <div class='jdgm-rev__br'></div> <span class='jdgm-rev__buyer-badge-wrapper'> <span class='jdgm-rev__buyer-badge'></span> </span> <span class='jdgm-rev__author-wrapper'> <span class='jdgm-rev__author'>James Broom</span> <span class='jdgm-rev__location' >  </span>  </span> </div> <div class='jdgm-rev__content'> <div class='jdgm-rev__custom-form'>  </div> <b class='jdgm-rev__title'>Lives up to the hype!</b> <div class='jdgm-rev__body'><p>Got the screwdriver and all available sets of bits. Not much I canâ€™t take apart now. The bits live in an Altoids tin with an insert from thingiverse. So far no damage to any bits and I have extras of common ones.</p></div> <div class='jdgm-rev__pics'>  </div> <div class='jdgm-rev__vids'>   </div> </div> <div class='jdgm-rev__actions'> <div class='jdgm-rev__social'></div> <div class='jdgm-rev__votes'></div> </div> <div class='jdgm-rev__reply'>  </div> </div><div class='jdgm-rev jdgm-divider-top' data-verified-buyer='true' data-review-id='4d9f7fda-abc2-4f5b-8b7b-7382d751aca2' data-product-title='Screwdriver Bit Set' data-product-url='/products/bits' data-thumb-up-count='2' data-thumb-down-count='0'> <div class='jdgm-rev__header'>  <div class='jdgm-rev__icon' > E </div>  <span class='jdgm-rev__rating' data-score='5' tabindex='0' aria-label='5 star review' role='img'> <span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span> </span> <span class='jdgm-rev__timestamp jdgm-spinner' data-content='2023-03-24 00:45:11 UTC'></span>    <div class='jdgm-rev__br'></div> <span class='jdgm-rev__buyer-badge-wrapper'> <span class='jdgm-rev__buyer-badge'></span> </span> <span class='jdgm-rev__author-wrapper'> <span class='jdgm-rev__author'>Eric D.</span> <span class='jdgm-rev__location' >  </span>  </span> </div> <div class='jdgm-rev__content'> <div class='jdgm-rev__custom-form'>  </div> <b class='jdgm-rev__title'>Definitly a screwdriver</b> <div class='jdgm-rev__body'><p>strong magnet, good bits.  satisfying to use.  Just waiting for the torx bit set now</p></div> <div class='jdgm-rev__pics'>  </div> <div class='jdgm-rev__vids'>   </div> </div> <div class='jdgm-rev__actions'> <div class='jdgm-rev__social'></div> <div class='jdgm-rev__votes'></div> </div> <div class='jdgm-rev__reply'>  </div> </div><div class='jdgm-rev jdgm-divider-top' data-verified-buyer='true' data-review-id='f7cee527-b71e-4960-9b16-6522aee721f9' data-product-title='Screwdriver Bit Set' data-product-url='/products/bits' data-thumb-up-count='6' data-thumb-down-count='0'> <div class='jdgm-rev__header'>  <div class='jdgm-rev__icon' > G </div>  <span class='jdgm-rev__rating' data-score='5' tabindex='0' aria-label='5 star review' role='img'> <span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span> </span> <span class='jdgm-rev__timestamp jdgm-spinner' data-content='2023-03-13 13:03:51 UTC'></span>    <div class='jdgm-rev__br'></div> <span class='jdgm-rev__buyer-badge-wrapper'> <span class='jdgm-rev__buyer-badge'></span> </span> <span class='jdgm-rev__author-wrapper'> <span class='jdgm-rev__author'>Gregus</span> <span class='jdgm-rev__location' >  </span>  </span> </div> <div class='jdgm-rev__content'> <div class='jdgm-rev__custom-form'>  </div> <b class='jdgm-rev__title'>Not much to say</b> <div class='jdgm-rev__body'><p>They show some wear in tear on the coating, but the fits are good and the corners are holding up because of it. I expect these to last me a while and when they do start to wear, the price is still good.</p>

<p>Just waiting for the torx set to come back in stock.</p></div> <div class='jdgm-rev__pics'>  </div> <div class='jdgm-rev__vids'>   </div> </div> <div class='jdgm-rev__actions'> <div class='jdgm-rev__social'></div> <div class='jdgm-rev__votes'></div> </div> <div class='jdgm-rev__reply'>  </div> </div><div class='jdgm-rev jdgm-divider-top' data-verified-buyer='true' data-review-id='a794d735-a982-4371-92f9-0aa5134465b1' data-product-title='Screwdriver Bit Set' data-product-url='/products/bits' data-thumb-up-count='1' data-thumb-down-count='0'> <div class='jdgm-rev__header'>  <div class='jdgm-rev__icon' > J </div>  <span class='jdgm-rev__rating' data-score='5' tabindex='0' aria-label='5 star review' role='img'> <span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span> </span> <span class='jdgm-rev__timestamp jdgm-spinner' data-content='2023-03-06 00:56:02 UTC'></span>    <div class='jdgm-rev__br'></div> <span class='jdgm-rev__buyer-badge-wrapper'> <span class='jdgm-rev__buyer-badge'></span> </span> <span class='jdgm-rev__author-wrapper'> <span class='jdgm-rev__author'>Jonathan Eakin</span> <span class='jdgm-rev__location' >  </span>  </span> </div> <div class='jdgm-rev__content'> <div class='jdgm-rev__custom-form'>  </div> <b class='jdgm-rev__title'>Good bits</b> <div class='jdgm-rev__body'><p>Been using the LTT screwdriver for a couple months now, no real complaints. The black coating has started to wear off on some of the bits, but I expected that. Every other black bit from other drivers I've had do the same. None have broken yet either. Am satisfied.</p></div> <div class='jdgm-rev__pics'>  </div> <div class='jdgm-rev__vids'>   </div> </div> <div class='jdgm-rev__actions'> <div class='jdgm-rev__social'></div> <div class='jdgm-rev__votes'></div> </div> <div class='jdgm-rev__reply'>  </div> </div></div> <div class='jdgm-paginate' data-per-page='5' data-url='https://judge.me/reviews/reviews_for_widget'><a class='jdgm-paginate__page jdgm-paginate__first-page' data-page='1' aria-label='Page 1' tabindex='0'  role='button'></a><a class='jdgm-paginate__page jdgm-paginate__prev-page' data-page='20' aria-label='Page 20' tabindex='0' rel='prev' role='button'></a><a class='jdgm-paginate__page ' data-page='19' aria-label='Page 19' tabindex='0'  role='button'>19</a><a class='jdgm-paginate__page ' data-page='20' aria-label='Page 20' tabindex='0'  role='button'>20</a><a class='jdgm-paginate__page jdgm-curt' data-page='21' aria-label='Page 21' tabindex='0'  role='button'>21</a><a class='jdgm-paginate__page ' data-page='22' aria-label='Page 22' tabindex='0'  role='button'>22</a><a class='jdgm-paginate__page ' data-page='23' aria-label='Page 23' tabindex='0'  role='button'>23</a><a class='jdgm-paginate__page jdgm-paginate__next-page' data-page='22' aria-label='Page 22' tabindex='0' rel='next' role='button'></a><a class='jdgm-paginate__page jdgm-paginate__last-page' data-page='61' aria-label='Page 61' tabindex='0'  role='button'></a></div>","total_count":302,"page":"21"}

{"html":"<div class='jdgm-rev-widg__reviews'><div class='jdgm-rev jdgm-divider-top' data-verified-buyer='true' data-review-id='e48dbc12-1991-49b2-9979-9d731a4c6b11' data-product-title='Screwdriver Bit Set' data-product-url='/products/bits' data-thumb-up-count='5' data-thumb-down-count='1'> <div class='jdgm-rev__header'>  <div class='jdgm-rev__icon' > L </div>  <span class='jdgm-rev__rating' data-score='4' tabindex='0' aria-label='4 star review' role='img'> <span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--off'></span> </span> <span class='jdgm-rev__timestamp jdgm-spinner' data-content='2022-12-05 17:53:38 UTC'></span>    <div class='jdgm-rev__br'></div> <span class='jdgm-rev__buyer-badge-wrapper'> <span class='jdgm-rev__buyer-badge'></span> </span> <span class='jdgm-rev__author-wrapper'> <span class='jdgm-rev__author'>Louis Edelman</span> <span class='jdgm-rev__location' >  </span>  </span> </div> <div class='jdgm-rev__content'> <div class='jdgm-rev__custom-form'>  </div> <b class='jdgm-rev__title'>Good Bits but lacking in places.</b> <div class='jdgm-rev__body'><p>First, I echo the need for a basic bit holder. This is especially needed for us heavy hex users. I ended up buying a set of Wiha bits just for their excellent holder.</p>

<p>On the subject of hex, please offer ball head hex bits! They make life so much easier in a tight spot.</p></div> <div class='jdgm-rev__pics'>  </div> <div class='jdgm-rev__vids'>   </div> </div> <div class='jdgm-rev__actions'> <div class='jdgm-rev__social'></div> <div class='jdgm-rev__votes'></div> </div> <div class='jdgm-rev__reply'>  </div> </div><div class='jdgm-rev jdgm-divider-top' data-verified-buyer='true' data-review-id='ee9432eb-feb9-4af6-95f4-34f7ca75d336' data-product-title='Screwdriver Bit Set' data-product-url='/products/bits' data-thumb-up-count='6' data-thumb-down-count='2'> <div class='jdgm-rev__header'>  <div class='jdgm-rev__icon' > O </div>  <span class='jdgm-rev__rating' data-score='4' tabindex='0' aria-label='4 star review' role='img'> <span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--off'></span> </span> <span class='jdgm-rev__timestamp jdgm-spinner' data-content='2022-12-05 14:49:59 UTC'></span>    <div class='jdgm-rev__br'></div> <span class='jdgm-rev__buyer-badge-wrapper'> <span class='jdgm-rev__buyer-badge'></span> </span> <span class='jdgm-rev__author-wrapper'> <span class='jdgm-rev__author'>Ozzie</span> <span class='jdgm-rev__location' >  </span>  </span> </div> <div class='jdgm-rev__content'> <div class='jdgm-rev__custom-form'>  </div> <b class='jdgm-rev__title'>The bits are great. Why no holders?</b> <div class='jdgm-rev__body'><p>I purchased every set of bits available.  So far, every one of them performs as expected.  They are great!  But I'm dumbfounded by the your decision to not include a holder for each set.  Even the absolute cheapest sets of bits that can be found on Amazon - you know, the ones from China - even those have holders, and they include more bits - like 7-8x more - for the same price or less than LTT's sets.  Surely the cost associated with including a holder is negligible at best.</p></div> <div class='jdgm-rev__pics'>  </div> <div class='jdgm-rev__vids'>   </div> </div> <div class='jdgm-rev__actions'> <div class='jdgm-rev__social'></div> <div class='jdgm-rev__votes'></div> </div> <div class='jdgm-rev__reply'>  </div> </div><div class='jdgm-rev jdgm-divider-top' data-verified-buyer='true' data-review-id='b2b06521-5fc1-4cc1-acb7-eabe4eb9347c' data-product-title='Screwdriver Bit Set' data-product-url='/products/bits' data-thumb-up-count='3' data-thumb-down-count='0'> <div class='jdgm-rev__header'>  <div class='jdgm-rev__icon' > X </div>  <span class='jdgm-rev__rating' data-score='5' tabindex='0' aria-label='5 star review' role='img'> <span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span> </span> <span class='jdgm-rev__timestamp jdgm-spinner' data-content='2022-12-05 14:47:29 UTC'></span>    <div class='jdgm-rev__br'></div> <span class='jdgm-rev__buyer-badge-wrapper'> <span class='jdgm-rev__buyer-badge'></span> </span> <span class='jdgm-rev__author-wrapper'> <span class='jdgm-rev__author'>Xavier Pena</span> <span class='jdgm-rev__location' >  </span>  </span> </div> <div class='jdgm-rev__content'> <div class='jdgm-rev__custom-form'>  </div> <b class='jdgm-rev__title'>Bit set</b> <div class='jdgm-rev__body'><p>They are sturdy and worth the price!</p></div> <div class='jdgm-rev__pics'>  </div> <div class='jdgm-rev__vids'>   </div> </div> <div class='jdgm-rev__actions'> <div class='jdgm-rev__social'></div> <div class='jdgm-rev__votes'></div> </div> <div class='jdgm-rev__reply'>  </div> </div><div class='jdgm-rev jdgm-divider-top' data-verified-buyer='true' data-review-id='f8545390-8eaa-483d-a485-ce9cfea06d38' data-product-title='Screwdriver Bit Set' data-product-url='/products/bits' data-thumb-up-count='4' data-thumb-down-count='1'> <div class='jdgm-rev__header'>  <div class='jdgm-rev__icon' > S </div>  <span class='jdgm-rev__rating' data-score='4' tabindex='0' aria-label='4 star review' role='img'> <span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--off'></span> </span> <span class='jdgm-rev__timestamp jdgm-spinner' data-content='2022-12-05 05:45:47 UTC'></span>    <div class='jdgm-rev__br'></div> <span class='jdgm-rev__buyer-badge-wrapper'> <span class='jdgm-rev__buyer-badge'></span> </span> <span class='jdgm-rev__author-wrapper'> <span class='jdgm-rev__author'>Sean</span> <span class='jdgm-rev__location' >  </span>  </span> </div> <div class='jdgm-rev__content'> <div class='jdgm-rev__custom-form'>  </div> <b class='jdgm-rev__title'>Bit Set</b> <div class='jdgm-rev__body'><p>The bit sets themselves get 5 stars for quality. The form factor and material choice us perfect. </p>

<p>I'm lowering the review down to 4 stars because of packaging. They come in a pretty cardboard holder that I can't see lasting more than a few months of casual use. I wish that they shipped with a small plastic holder to begin with. I would love if there is an option to purchase a plastic holder in the future for all who buy the optional extras.</p></div> <div class='jdgm-rev__pics'>  </div> <div class='jdgm-rev__vids'>   </div> </div> <div class='jdgm-rev__actions'> <div class='jdgm-rev__social'></div> <div class='jdgm-rev__votes'></div> </div> <div class='jdgm-rev__reply'>  </div> </div><div class='jdgm-rev jdgm-divider-top' data-verified-buyer='true' data-review-id='a00c847a-1a1e-4989-ace7-faf3d0924b3e' data-product-title='Screwdriver Bit Set' data-product-url='/products/bits' data-thumb-up-count='0' data-thumb-down-count='0'> <div class='jdgm-rev__header'>  <div class='jdgm-rev__icon' > D </div>  <span class='jdgm-rev__rating' data-score='5' tabindex='0' aria-label='5 star review' role='img'> <span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span> </span> <span class='jdgm-rev__timestamp jdgm-spinner' data-content='2022-12-04 22:47:35 UTC'></span>    <div class='jdgm-rev__br'></div> <span class='jdgm-rev__buyer-badge-wrapper'> <span class='jdgm-rev__buyer-badge'></span> </span> <span class='jdgm-rev__author-wrapper'> <span class='jdgm-rev__author'>Derek Bradley</span> <span class='jdgm-rev__location' >  </span>  </span> </div> <div class='jdgm-rev__content'> <div class='jdgm-rev__custom-form'>  </div> <b class='jdgm-rev__title'>Good to have options!</b> <div class='jdgm-rev__body'><p>I love having all the bit sets ready to go at a moments notice! I highly recommend grabbing them all, because you never know when they'll come in handy!</p></div> <div class='jdgm-rev__pics'>  </div> <div class='jdgm-rev__vids'>   </div> </div> <div class='jdgm-rev__actions'> <div class='jdgm-rev__social'></div> <div class='jdgm-rev__votes'></div> </div> <div class='jdgm-rev__reply'>  </div> </div></div> <div class='jdgm-paginate' data-per-page='5' data-url='https://judge.me/reviews/reviews_for_widget'><a class='jdgm-paginate__page jdgm-paginate__first-page' data-page='1' aria-label='Page 1' tabindex='0'  role='button'></a><a class='jdgm-paginate__page jdgm-paginate__prev-page' data-page='51' aria-label='Page 51' tabindex='0' rel='prev' role='button'></a><a class='jdgm-paginate__page ' data-page='50' aria-label='Page 50' tabindex='0'  role='button'>50</a><a class='jdgm-paginate__page ' data-page='51' aria-label='Page 51' tabindex='0'  role='button'>51</a><a class='jdgm-paginate__page jdgm-curt' data-page='52' aria-label='Page 52' tabindex='0'  role='button'>52</a><a class='jdgm-paginate__page ' data-page='53' aria-label='Page 53' tabindex='0'  role='button'>53</a><a class='jdgm-paginate__page ' data-page='54' aria-label='Page 54' tabindex='0'  role='button'>54</a><a class='jdgm-paginate__page jdgm-paginate__next-page' data-page='53' aria-label='Page 53' tabindex='0' rel='next' role='button'></a><a class='jdgm-paginate__page jdgm-paginate__last-page' data-page='61' aria-label='Page 61' tabindex='0'  role='button'></a></div>","total_count":302,"page":"52"}

{"html":"<div class='jdgm-rev-widg__reviews'><div class='jdgm-rev jdgm-divider-top' data-verified-buyer='true' data-review-id='c76c9258-2548-4467-b600-18d6a3ae63aa' data-product-title='Screwdriver Bit Set' data-product-url='/products/bits' data-thumb-up-count='2' data-thumb-down-count='1'> <div class='jdgm-rev__header'>  <div class='jdgm-rev__icon' > M </div>  <span class='jdgm-rev__rating' data-score='4' tabindex='0' aria-label='4 star review' role='img'> <span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--off'></span> </span> <span class='jdgm-rev__timestamp jdgm-spinner' data-content='2022-12-03 14:35:22 UTC'></span>    <div class='jdgm-rev__br'></div> <span class='jdgm-rev__buyer-badge-wrapper'> <span class='jdgm-rev__buyer-badge'></span> </span> <span class='jdgm-rev__author-wrapper'> <span class='jdgm-rev__author'>Michael W.</span> <span class='jdgm-rev__location' >  </span>  </span> </div> <div class='jdgm-rev__content'> <div class='jdgm-rev__custom-form'>  </div> <b class='jdgm-rev__title'>No complaints for the bits, but packaging could be better</b> <div class='jdgm-rev__body'><p>Bits: no issues
<br />Packaging: my metric hex set box arrived opened and the bits are everywhere in the delivery box, luckily everything was there. My other set was fine. It seems like this is a common issue, maybe tape to make sure the box doesnâ€™t open (but excessive use of plastic or a recyclable tape idk does it exist) or maybe a redesign (man hours but for good user experience right)</p></div> <div class='jdgm-rev__pics'>  </div> <div class='jdgm-rev__vids'>   </div> </div> <div class='jdgm-rev__actions'> <div class='jdgm-rev__social'></div> <div class='jdgm-rev__votes'></div> </div> <div class='jdgm-rev__reply'>  </div> </div><div class='jdgm-rev jdgm-divider-top' data-verified-buyer='false' data-review-id='e98ffc26-f2c0-42f3-b316-5fa3cfda8e42' data-product-title='Screwdriver Bit Set' data-product-url='/products/bits' data-thumb-up-count='0' data-thumb-down-count='0'> <div class='jdgm-rev__header'>  <div class='jdgm-rev__icon' > X </div>  <span class='jdgm-rev__rating' data-score='5' tabindex='0' aria-label='5 star review' role='img'> <span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span> </span> <span class='jdgm-rev__timestamp jdgm-spinner' data-content='2022-12-01 17:36:25 UTC'></span>    <div class='jdgm-rev__br'></div> <span class='jdgm-rev__buyer-badge-wrapper'>  </span> <span class='jdgm-rev__author-wrapper'> <span class='jdgm-rev__author'>X.P.C.</span> <span class='jdgm-rev__location' >  </span>  </span> </div> <div class='jdgm-rev__content'> <div class='jdgm-rev__custom-form'>  </div> <b class='jdgm-rev__title'>Better screwdriver than I thought</b> <div class='jdgm-rev__body'><p>This is better than I originally thought.  Its much bigger screwdriver than I thought it would be and after using I realize why.  Bigger is so it doesn't fall out of your hand while using.  I compared it to other smaller screwdrivers I have at home and in the past the screwdrivers would fall out of my hand.  But not this one.  Also I think you should not include flat head bits in your screwdriver.  Nothing uses flat head, everything is philips or hex, TRs.  I bought the TR bits and going to replace others with it.</p></div> <div class='jdgm-rev__pics'>  </div> <div class='jdgm-rev__vids'>   </div> </div> <div class='jdgm-rev__actions'> <div class='jdgm-rev__social'></div> <div class='jdgm-rev__votes'></div> </div> <div class='jdgm-rev__reply'>  </div> </div><div class='jdgm-rev jdgm-divider-top' data-verified-buyer='true' data-review-id='faeef36e-9825-4de2-affc-2c4d6eb0d209' data-product-title='Screwdriver Bit Set' data-product-url='/products/bits' data-thumb-up-count='7' data-thumb-down-count='2'> <div class='jdgm-rev__header'>  <div class='jdgm-rev__icon' > G </div>  <span class='jdgm-rev__rating' data-score='3' tabindex='0' aria-label='3 star review' role='img'> <span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--off'></span><span class='jdgm-star jdgm--off'></span> </span> <span class='jdgm-rev__timestamp jdgm-spinner' data-content='2022-11-29 23:55:42 UTC'></span>    <div class='jdgm-rev__br'></div> <span class='jdgm-rev__buyer-badge-wrapper'> <span class='jdgm-rev__buyer-badge'></span> </span> <span class='jdgm-rev__author-wrapper'> <span class='jdgm-rev__author'>Gregory H.</span> <span class='jdgm-rev__location' >  </span>  </span> </div> <div class='jdgm-rev__content'> <div class='jdgm-rev__custom-form'>  </div> <b class='jdgm-rev__title'>Specialty Bits Missing</b> <div class='jdgm-rev__body'><p>Received my screwdriver and specialty bits today. And while I'm excited and happy with the screwdriver and main bits, the specialty bits came with a few flaws. I received two P6 bits and no P5, as well as an unmarked bit. The unmarked bit seems like it should be the Y000 bit but it is the same size as the Y00 bit.</p></div> <div class='jdgm-rev__pics'>  <a class='jdgm-rev__pic-link jdgm--loading' target='_blank' rel='nofollow' href='https://judgeme.imgix.net/linus-tech-tips-store/1669766809__20221129_185826__original.jpg?auto=format' data-mfp-src='https://judgeme.imgix.net/linus-tech-tips-store/1669766809__20221129_185826__original.jpg?auto=format&amp;w=1024' aria-label='Link to user picture 1'> <img class='jdgm-rev__pic-img' alt='User picture' data-src='https://judgeme.imgix.net/linus-tech-tips-store/1669766809__20221129_185826__original.jpg?auto=format&amp;w=160'> </a>  <a class='jdgm-rev__pic-link jdgm--loading' target='_blank' rel='nofollow' href='https://judgeme.imgix.net/linus-tech-tips-store/1669766811__20221129_190252__original.jpg?auto=format' data-mfp-src='https://judgeme.imgix.net/linus-tech-tips-store/1669766811__20221129_190252__original.jpg?auto=format&amp;w=1024' aria-label='Link to user picture 2'> <img class='jdgm-rev__pic-img' alt='User picture' data-src='https://judgeme.imgix.net/linus-tech-tips-store/1669766811__20221129_190252__original.jpg?auto=format&amp;w=160'> </a>  </div> <div class='jdgm-rev__vids'>   </div> </div> <div class='jdgm-rev__actions'> <div class='jdgm-rev__social'></div> <div class='jdgm-rev__votes'></div> </div> <div class='jdgm-rev__reply'>  </div> </div><div class='jdgm-rev jdgm-divider-top' data-verified-buyer='true' data-review-id='2a98f3e2-ef08-4851-b561-709309fc8957' data-product-title='Screwdriver Bit Set' data-product-url='/products/bits' data-thumb-up-count='1' data-thumb-down-count='0'> <div class='jdgm-rev__header'>  <div class='jdgm-rev__icon' > d </div>  <span class='jdgm-rev__rating' data-score='5' tabindex='0' aria-label='5 star review' role='img'> <span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span> </span> <span class='jdgm-rev__timestamp jdgm-spinner' data-content='2022-11-28 01:04:38 UTC'></span>    <div class='jdgm-rev__br'></div> <span class='jdgm-rev__buyer-badge-wrapper'> <span class='jdgm-rev__buyer-badge'></span> </span> <span class='jdgm-rev__author-wrapper'> <span class='jdgm-rev__author'>dylaneatscake</span> <span class='jdgm-rev__location' >  </span>  </span> </div> <div class='jdgm-rev__content'> <div class='jdgm-rev__custom-form'>  </div> <b class='jdgm-rev__title'>Great quality bits</b> <div class='jdgm-rev__body'><p>I bought one of each bit set and have had no issues with any of the bits. I do wish there was a bit storage holder aside from the screwdriver itself, but that has nothing to do with the quality of these bits. If I ever loose any bits I will definitely have no doubts about buying these again.</p></div> <div class='jdgm-rev__pics'>  </div> <div class='jdgm-rev__vids'>   </div> </div> <div class='jdgm-rev__actions'> <div class='jdgm-rev__social'></div> <div class='jdgm-rev__votes'></div> </div> <div class='jdgm-rev__reply'>  </div> </div><div class='jdgm-rev jdgm-divider-top' data-verified-buyer='true' data-review-id='c239f030-452e-4c7e-8eca-1d87dc503cf4' data-product-title='Screwdriver Bit Set' data-product-url='/products/bits' data-thumb-up-count='3' data-thumb-down-count='1'> <div class='jdgm-rev__header'>  <div class='jdgm-rev__icon' > N </div>  <span class='jdgm-rev__rating' data-score='4' tabindex='0' aria-label='4 star review' role='img'> <span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--off'></span> </span> <span class='jdgm-rev__timestamp jdgm-spinner' data-content='2022-11-24 18:39:41 UTC'></span>    <div class='jdgm-rev__br'></div> <span class='jdgm-rev__buyer-badge-wrapper'> <span class='jdgm-rev__buyer-badge'></span> </span> <span class='jdgm-rev__author-wrapper'> <span class='jdgm-rev__author'>Nicolai</span> <span class='jdgm-rev__location' >  </span>  </span> </div> <div class='jdgm-rev__content'> <div class='jdgm-rev__custom-form'>  </div> <b class='jdgm-rev__title'>Love the bits! Horrible packaging tho...</b> <div class='jdgm-rev__body'><p>The bits seems to be high quality and I love the extra magnet strenght they provide over standard bits. But you guys rly need to fix the packaging, when I recived my box of stuff including the screwdriver, my 3 extra packs of bits had all opened during shipping, and the bits were all mixed in the bottom of the box. Two of the packs were also ripped open so now I dont have any way of storing them in an organized manner. </p>

<p>As I have also read from other reviews a simple rubber or plastic holder would have been a great solution, that I would have gladly paid a little extra for.</p></div> <div class='jdgm-rev__pics'>  </div> <div class='jdgm-rev__vids'>   </div> </div> <div class='jdgm-rev__actions'> <div class='jdgm-rev__social'></div> <div class='jdgm-rev__votes'></div> </div> <div class='jdgm-rev__reply'>  </div> </div></div> <div class='jdgm-paginate' data-per-page='5' data-url='https://judge.me/reviews/reviews_for_widget'><a class='jdgm-paginate__page jdgm-paginate__first-page' data-page='1' aria-label='Page 1' tabindex='0'  role='button'></a><a class='jdgm-paginate__page jdgm-paginate__prev-page' data-page='53' aria-label='Page 53' tabindex='0' rel='prev' role='button'></a><a class='jdgm-paginate__page ' data-page='52' aria-label='Page 52' tabindex='0'  role='button'>52</a><a class='jdgm-paginate__page ' data-page='53' aria-label='Page 53' tabindex='0'  role='button'>53</a><a class='jdgm-paginate__page jdgm-curt' data-page='54' aria-label='Page 54' tabindex='0'  role='button'>54</a><a class='jdgm-paginate__page ' data-page='55' aria-label='Page 55' tabindex='0'  role='button'>55</a><a class='jdgm-paginate__page ' data-page='56' aria-label='Page 56' tabindex='0'  role='button'>56</a><a class='jdgm-paginate__page jdgm-paginate__next-page' data-page='55' aria-label='Page 55' tabindex='0' rel='next' role='button'></a><a class='jdgm-paginate__page jdgm-paginate__last-page' data-page='61' aria-label='Page 61' tabindex='0'  role='button'></a></div>","total_count":302,"page":"54"}

{"html":"<div class='jdgm-rev-widg__reviews'><div class='jdgm-rev jdgm-divider-top' data-verified-buyer='true' data-review-id='bf05da69-dafa-4666-8b0b-78763177747e' data-product-title='Screwdriver Bit Set' data-product-url='/products/bits' data-thumb-up-count='2' data-thumb-down-count='3'> <div class='jdgm-rev__header'>  <div class='jdgm-rev__icon' > D </div>  <span class='jdgm-rev__rating' data-score='5' tabindex='0' aria-label='5 star review' role='img'> <span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span> </span> <span class='jdgm-rev__timestamp jdgm-spinner' data-content='2022-11-17 14:49:16 UTC'></span>    <div class='jdgm-rev__br'></div> <span class='jdgm-rev__buyer-badge-wrapper'> <span class='jdgm-rev__buyer-badge'></span> </span> <span class='jdgm-rev__author-wrapper'> <span class='jdgm-rev__author'>Daniel Power</span> <span class='jdgm-rev__location' >  </span>  </span> </div> <div class='jdgm-rev__content'> <div class='jdgm-rev__custom-form'>  </div> <b class='jdgm-rev__title'>Bad packaging</b> <div class='jdgm-rev__body'><p>The bits seem to be good enough quality. But I'm frustrated that there's no re-usable holder for them. I bought every bit set so that my LTT Screwdriver would be ready for whatever I throw at it. But these flimsy paper packages are not going to hold up in my tool bag. And there's nothing holding the bits in place. So if you take one out for use, the remaining bits will move around in the package, so you can't quickly place the bit back where it was maintaining order.</p>

<p>There's also no indication from the outside which bit is where, so you'll need to hunt and peck, reading the engraving on the individual bit if you're looking for a specific size. Highly disappointed by this.</p>

<p>It seems Linus felt the meme number pricing was so important to him, it was worth sacrificing quality. I would have happily paid the extra 50 cents or whatever it would have cost to get a simple rubber bit holder.</p></div> <div class='jdgm-rev__pics'>  </div> <div class='jdgm-rev__vids'>   </div> </div> <div class='jdgm-rev__actions'> <div class='jdgm-rev__social'></div> <div class='jdgm-rev__votes'></div> </div> <div class='jdgm-rev__reply'>  </div> </div><div class='jdgm-rev jdgm-divider-top' data-verified-buyer='true' data-review-id='e7bbcf38-ece7-4dca-bfde-48c55ebebc23' data-product-title='Screwdriver Bit Set' data-product-url='/products/bits' data-thumb-up-count='5' data-thumb-down-count='1'> <div class='jdgm-rev__header'>  <div class='jdgm-rev__icon' > K </div>  <span class='jdgm-rev__rating' data-score='5' tabindex='0' aria-label='5 star review' role='img'> <span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span> </span> <span class='jdgm-rev__timestamp jdgm-spinner' data-content='2022-11-17 12:21:25 UTC'></span>    <div class='jdgm-rev__br'></div> <span class='jdgm-rev__buyer-badge-wrapper'> <span class='jdgm-rev__buyer-badge'></span> </span> <span class='jdgm-rev__author-wrapper'> <span class='jdgm-rev__author'>Kristjan</span> <span class='jdgm-rev__location' >  </span>  </span> </div> <div class='jdgm-rev__content'> <div class='jdgm-rev__custom-form'>  </div> <b class='jdgm-rev__title'>Good bits, bad packaging</b> <div class='jdgm-rev__body'><p>I bought the speciality and security torxs bit sets. I have used them for a week now and they seem really high quality (no fraying). One problem i have is that the bits were just tossed loosely in the box and the specilaity bit set opened up and they were shattered around the box. 3 bits were missing. I would like to see an improvement in the packaging</p></div> <div class='jdgm-rev__pics'>  <a class='jdgm-rev__pic-link jdgm--loading' target='_blank' rel='nofollow' href='https://judgeme.imgix.net/linus-tech-tips-store/1668698751__20221115_125320__original.jpg?auto=format' data-mfp-src='https://judgeme.imgix.net/linus-tech-tips-store/1668698751__20221115_125320__original.jpg?auto=format&amp;w=1024' aria-label='Link to user picture 1'> <img class='jdgm-rev__pic-img' alt='User picture' data-src='https://judgeme.imgix.net/linus-tech-tips-store/1668698751__20221115_125320__original.jpg?auto=format&amp;w=160'> </a>  <a class='jdgm-rev__pic-link jdgm--loading' target='_blank' rel='nofollow' href='https://judgeme.imgix.net/linus-tech-tips-store/1668698753__20221115_125349__original.jpg?auto=format' data-mfp-src='https://judgeme.imgix.net/linus-tech-tips-store/1668698753__20221115_125349__original.jpg?auto=format&amp;w=1024' aria-label='Link to user picture 2'> <img class='jdgm-rev__pic-img' alt='User picture' data-src='https://judgeme.imgix.net/linus-tech-tips-store/1668698753__20221115_125349__original.jpg?auto=format&amp;w=160'> </a>  </div> <div class='jdgm-rev__vids'>   </div> </div> <div class='jdgm-rev__actions'> <div class='jdgm-rev__social'></div> <div class='jdgm-rev__votes'></div> </div> <div class='jdgm-rev__reply'>  </div> </div><div class='jdgm-rev jdgm-divider-top' data-verified-buyer='true' data-review-id='fcc09a42-2006-4994-b06d-dd9ef2cc960e' data-product-title='Screwdriver Bit Set' data-product-url='/products/bits' data-thumb-up-count='6' data-thumb-down-count='1'> <div class='jdgm-rev__header'>  <div class='jdgm-rev__icon' > F </div>  <span class='jdgm-rev__rating' data-score='4' tabindex='0' aria-label='4 star review' role='img'> <span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--off'></span> </span> <span class='jdgm-rev__timestamp jdgm-spinner' data-content='2022-11-14 18:57:38 UTC'></span>    <div class='jdgm-rev__br'></div> <span class='jdgm-rev__buyer-badge-wrapper'> <span class='jdgm-rev__buyer-badge'></span> </span> <span class='jdgm-rev__author-wrapper'> <span class='jdgm-rev__author'>FCM</span> <span class='jdgm-rev__location' >  </span>  </span> </div> <div class='jdgm-rev__content'> <div class='jdgm-rev__custom-form'>  </div> <b class='jdgm-rev__title'>Great bits, but like almost everyone mentions in their review we need a bit holder/case</b> <div class='jdgm-rev__body'><p>Let's do it, LTT team - custom bit holder please.</p></div> <div class='jdgm-rev__pics'>  </div> <div class='jdgm-rev__vids'>   </div> </div> <div class='jdgm-rev__actions'> <div class='jdgm-rev__social'></div> <div class='jdgm-rev__votes'></div> </div> <div class='jdgm-rev__reply'>  </div> </div><div class='jdgm-rev jdgm-divider-top' data-verified-buyer='true' data-review-id='5ee2f09e-bae9-5581-bd08-25008f31873e' data-product-title='Screwdriver Bit Set' data-product-url='/products/bits' data-thumb-up-count='0' data-thumb-down-count='7'> <div class='jdgm-rev__header'>  <div class='jdgm-rev__icon' > P </div>  <span class='jdgm-rev__rating' data-score='1' tabindex='0' aria-label='1 star review' role='img'> <span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--off'></span><span class='jdgm-star jdgm--off'></span><span class='jdgm-star jdgm--off'></span><span class='jdgm-star jdgm--off'></span> </span> <span class='jdgm-rev__timestamp jdgm-spinner' data-content='2022-11-14 17:38:19 UTC'></span>    <div class='jdgm-rev__br'></div> <span class='jdgm-rev__buyer-badge-wrapper'> <span class='jdgm-rev__buyer-badge'></span> </span> <span class='jdgm-rev__author-wrapper'> <span class='jdgm-rev__author'>PHILLIP</span> <span class='jdgm-rev__location' >  </span> <span class='jdgm-rev__source' data-source="shop-app"></span> </span> </div> <div class='jdgm-rev__content'> <div class='jdgm-rev__custom-form'>  </div> <b class='jdgm-rev__title'></b> <div class='jdgm-rev__body'><p>Not what I was expecting. It doesnâ€™t fit any of my drivers I own.</p></div> <div class='jdgm-rev__pics'>  </div> <div class='jdgm-rev__vids'>   </div> </div> <div class='jdgm-rev__actions'> <div class='jdgm-rev__social'></div> <div class='jdgm-rev__votes'></div> </div> <div class='jdgm-rev__reply'>  </div> </div><div class='jdgm-rev jdgm-divider-top' data-verified-buyer='true' data-review-id='fac78399-684c-4ef4-b1b9-be760aeeacbf' data-product-title='Screwdriver Bit Set' data-product-url='/products/bits' data-thumb-up-count='0' data-thumb-down-count='0'> <div class='jdgm-rev__header'>  <div class='jdgm-rev__icon' > T </div>  <span class='jdgm-rev__rating' data-score='5' tabindex='0' aria-label='5 star review' role='img'> <span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span><span class='jdgm-star jdgm--on'></span> </span> <span class='jdgm-rev__timestamp jdgm-spinner' data-content='2022-11-12 14:43:20 UTC'></span>    <div class='jdgm-rev__br'></div> <span class='jdgm-rev__buyer-badge-wrapper'> <span class='jdgm-rev__buyer-badge'></span> </span> <span class='jdgm-rev__author-wrapper'> <span class='jdgm-rev__author'>Trenton Riopel</span> <span class='jdgm-rev__location' >  </span>  </span> </div> <div class='jdgm-rev__content'> <div class='jdgm-rev__custom-form'>  </div> <b class='jdgm-rev__title'>Bits are string and take everything I can throw at them</b> <div class='jdgm-rev__body'><p>For being so small abs fitting into the screwdriver the way they do itâ€™s great, they donâ€™t chip or bend when being used abs it is perfect for making and repairing computers</p></div> <div class='jdgm-rev__pics'>  </div> <div class='jdgm-rev__vids'>   </div> </div> <div class='jdgm-rev__actions'> <div class='jdgm-rev__social'></div> <div class='jdgm-rev__votes'></div> </div> <div class='jdgm-rev__reply'>  </div> </div></div> <div class='jdgm-paginate' data-per-page='5'